import React from "react";

import './banner.scss'

import Logo from "../../assets/logo-2032.png";

const Banner = () => {
  return (
    <div className="banner-container flex">
      <div className="banner-logo">
        <img src={ Logo } alt="" />
      </div>

      {/* <div className="banner-right-content">
        <img src={ Logo } alt="" />
      </div> */}
    </div>
  );
};

export default Banner;
